import './ServiceCard.css';
import Image from './banner_1.jpg';
import Logo from 'profession.png';


function ServiceCard(props) {

    return (
        // <div className="serviceContainer" style={{background: `url(${Image})`}}>
            <div className="card center">
                <div className="front">
                    <img src={Logo} />
                </div>
                <div className="back">
                    <div className="back-content center">
                        <h2>{props.title}</h2>
                        <span>Подпишись на канал!</span>
                        <span>и ставьте</span>
                    </div>
                </div>
            </div>
        // </div>


    );
}

export default ServiceCard;
